import React, { useState } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

const RegisterPerson = () => {
  const [formData, setFormData] = useState({
    nombre: '',
    apellido: '',
    email: '',
    identificacion: '',
    usuario: {
      login: '',
      password: ''
    }
  });

  const [modalMessage, setModalMessage] = useState('');
  const [isError, setIsError] = useState(false);
  const [showModal, setShowModal] = useState(false);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value
    }));
  };

  const handleUserInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      usuario: {
        ...prevData.usuario,
        [name]: value
      }
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('/api/persona', formData);
      // Si la respuesta es exitosa, muestra un mensaje de éxito
      setModalMessage(response.data);
      setIsError(false);
    } catch (error) {
      // Si hay un error, muestra un mensaje de error
      setModalMessage(error.response?.data || 'Error desconocido');
      setIsError(true);
    }
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setShowModal(false);
  };

  return (
    <div className="container">
      <h2>Registrar Persona</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Nombre</label>
          <input type="text" className="form-control" name="nombre" onChange={handleInputChange} required />
        </div>
        <div className="form-group">
          <label>Apellido</label>
          <input type="text" className="form-control" name="apellido" onChange={handleInputChange} required />
        </div>
        <div className="form-group">
          <label>Email</label>
          <input type="email" className="form-control" name="email" onChange={handleInputChange} required />
        </div>
        <div className="form-group">
          <label>Identificación</label>
          <input type="text" className="form-control" name="identificacion" onChange={handleInputChange} required />
        </div>
        <div className="form-group">
          <label>Nombre de Usuario</label>
          <input type="text" className="form-control" name="login" onChange={handleUserInputChange} required />
        </div>
        <div className="form-group">
          <label>Contraseña</label>
          <input type="password" className="form-control" name="password" onChange={handleUserInputChange} required />
        </div>
        <button type="submit" className="btn btn-primary">Registrar</button>
      </form>

      {showModal && (
        <div className={`modal fade show ${isError ? 'bg-danger' : 'bg-success'}`} style={{ display: 'block' }}>
          <div className="modal-dialog">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">{isError ? 'Error' : 'Éxito'}</h5>
                <button type="button" className="close" onClick={handleCloseModal}>
                  &times;
                </button>
              </div>
              <div className="modal-body">
                <p>{modalMessage}</p>
              </div>
              <div className="modal-footer">
                <button type="button" className="btn btn-secondary" onClick={handleCloseModal}>
                  Cerrar
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Register;
